# _*_ coding: utf-8 _*_
import requests
import re
class getsms:
    @staticmethod
    def getcode():
        #url写入
        url='http://www.106818.com/SmsQuery.aspx'
        #cookies写入
        cookies={'ASP.NET_SessionId': 'ezblksacwzjvue55cvhr4455'}
        #参数写入
        data={
            '__VIEWSTATE' : '',
            '__EVENTVALIDATION':'/wEWCwK7mrf/AQLS2LaNCgKPya+TDQLa2rmZBwL1w9euAQK2i7exDgLX9fuEBwKH2tGhBQLH+pXeDwLLst7qDALLstbqDHrVwczFBb6lXKOW2xXCXeXpsxdl',
            'ctl00$ctl00$Holder1$Holder2$Phone':'17710203585'
        }
        #调用接口
        response = requests.post(url,cookies=cookies,data=data)
        #取出对应下标值
        sms=response.text.find('17710203585')
        #取出对应验证码
        code = re.findall(u"验证码.(\d*)",response.text[sms:])
        return code[0]
getsms.getcode()